,"description":"Specializations and courses in the arts and humanities (including fine arts, history, and philosophy) explore the historical context of creative works and teach you to review source material critically, draw connections between diverse ideas, and evaluate evidence and arguments. Los cursos en este campo le ayudarán a convertirse en un mejor lector, pensador, artista y escritor.","id":"arts-and-humanities"},{"subdomainIds":["leadership-and-management","finance","marketing","entrepreneurship","business-essentials","business-strategy"],"keywords":["pequeña empresa","negocios internacionales","administración de empresas","gestión empresarial","oportunidades","vender","finanzas","económico","global","ética","inversión"],"name":"Negocios","description":"Las Specializations y cursos de negocios le ayudarán a perfeccionar habilidades fundamentales para el éxito en el lugar de trabajo moderno, con áreas de estudio que incluyen el espíritu empresarial, la estrategia empresarial, el marketing, las finanzas y la gestión. Tanto si es propietario de una pequeña empresa como si trabaja en una gran firma internacional, los cursos de negocios mejorarán su capacidad para analizar, comprender y resolver problemas empresariales.","id":"business"},{"subdomainIds":["software-development","mobile-and-web-development","algorithms","computer-security-and-networks","design-and-product"],"keywords":["programa","ingeniería","introducción","teórico","matemáticas","proyectos","ciencia computacional","tecnología","redes","gráficos","aplicaciones","algoritmos","programación"],"name":"Ciencias de la Computación","description":"Las Specializations y cursos de informática enseñan ingeniería y diseño de software, pensamiento algorítmico, interacción persona-ordenador, lenguajes de programación e historia de la informática. Los cursos de este amplio campo le ayudarán a pensar de forma abstracta, abordar los problemas metódicamente y desarrollar soluciones sólidas.","id":"computer-science"},{"subdomainIds":["data-analysis","machine-learning","probability-and-statistics"],"keywords":["análisis de datos cualitativos","análisis exploratorio de datos","herramientas","métodos","técnicas","software","investigación","analista","interpretación"],"name":"Ciencia de Datos","description":"Las Specializations y los cursos de ciencia de datos enseñan los fundamentos de la interpretación de datos, la realización de análisis y la comprensión y comunicación de perspectivas procesables. Los temas de estudio para principiantes y avanzados incluyen el análisis cualitativo y cuantitativo de datos, herramientas y métodos para la manipulación de datos y algoritmos de aprendizaje automático.","id":"data-science"},{"subdomainIds":["cloud-computing","security","data-management","networking","support-and-operations"],"keywords":["redes","computación en la nube","Seguridad","gestión de datos","operaciones"],"name":"Tecnología de información","description":"Los cursos y Specializations de Tecnología de la Información (TI) enseñan computación en la nube, ciberseguridad, gestión de datos, redes y mucho más. Aprenda a utilizar los ordenadores para satisfacer las necesidades empresariales cotidianas y lance o avance en su carrera en el sector de las TI.","id":"information-technology"},{"subdomainIds":["animal-health","basic-science","health-informatics","healthcare-management","nutrition","patient-care","public-health","research","psychology"],"keywords":["ciencia","celular","molecular","agricultura","empresas","ramas","factor de impacto","bio","biotecnología","zoología","biología","neurociencia","horticultura","bioquímica","planta"],"name":"Salud","description":"Las Specializations y cursos de salud exploran temas relacionados con la ciencia, su salud y la salud y el bienestar de los demás. Tanto si está interesado en la ciencia, como si es un profesional sanitario formado o está buscando una transición a esta industria en rápido crecimiento, los cursos de salud mejorarán su capacidad para comprender la vida animal y vegetal, utilizar grandes datos para resolver retos sanitarios clave, gestionar equipos y llevar a cabo investigaciones basadas en pruebas.","id":"life-sciences","slug":"health"},{"subdomainIds":["math-and-logic"],"keywords":["problemas","lógico","matemáticas","Filosofía","calculadora","rompecabezas","lógicamente","pensando","razonamiento","falacias","computacional","símbolos","resolver","aplicaciones","todos los días","modelos"],"name":"Matemáticas y lógica","description":"Las Specializations y los cursos de matemáticas y lógica enseñan enfoques sólidos para resolver problemas cuantificables y abstractos. Abordará rompecabezas lógicos, desarrollará habilidades computacionales, aumentará su capacidad para representar de forma abstracta fenómenos del mundo real y reforzará su capacidad de razonamiento.","id":"math-and-logic"},{"subdomainIds":["personal-development"],"keywords":["plan","objetivos","competencias","entrenador","consejos","auto","mejora","personalidad","profesional","fijación de objetivos","crecimiento","actividades","mejor","acción","liderazgo"],"name":"Desarrollo personal","description":"Las Specializations y cursos de desarrollo personal enseñan estrategias y marcos para el crecimiento personal, la fijación de objetivos y la superación personal. Aprenderá a gestionar sus finanzas personales, a pronunciar discursos eficaces, a tomar decisiones éticas y a pensar de forma más creativa.","id":"personal-development"},{"subdomainIds":["electrical-engineering","mechanical-engineering","chemistry","environmental-science-and-sustainability","physics-and-astronomy","research-methods"],"keywords":["computadora","eléctrico","civil","mecánico","ciencias","física","matemáticas","ingeniero","química","material","química","tecnología","experimentos","astronomía","tierra","geociencia"],"name":"Ciencias Físicas e Ingeniería","description":"Ciencias físicas e ingeniería Las Specializations y cursos enseñan las propiedades del mundo que nos rodea, desde conceptos básicos de física y química hasta temas aplicados de ingeniería. Los cursos en este campo le prepararán para una carrera en ingeniería eléctrica, civil o mecánica, o en investigación o ciencia aplicada.","id":"physical-science-and-engineering"},{"subdomainIds":["economics","education","governance-and-society","law"],"keywords":["medicina","economía","humanidades","social","estudios","comportamiento","ciencia","aplicado","investigación","métodos","disciplinas","estadística","historia"],"name":"Ciencias Sociales","description":"Ciencias sociales Las especializaciones y cursos exploran cómo las poblaciones forman leyes, toman decisiones, se comportan en grupos y estructuran sus comunidades. Desde la educación a la economía pasando por el derecho, los cursos de ciencias sociales mejorarán su comprensión de la dinámica entre individuos y grupos, y su capacidad para analizar comportamientos y tendencias.","id":"social-sciences"},{"subdomainIds":["learning-english","other-languages"],"keywords":["lecciones","aprenda","aprendizaje de idiomas","aprender chino","aprender inglés","cursos de inglés","aprenda a hablar","lengua extranjera","español","otros idiomas","gramática","hablando","conversación","escribir"],"name":"Aprendizaje de idiomas","description":"En los cursos de idiomas y Specializations, aprenderá a hablar, escribir y escuchar con eficacia en las principales lenguas del mundo, como el inglés, el chino y el español, entre otras. Tanto si está aprendiendo una lengua extranjera como si está mejorando sus habilidades comunicativas en su lengua materna, los cursos en esta área le ayudarán a comprender las convenciones gramaticales y sintácticas, y le prepararán para comunicarse con confianza tanto en interacciones de negocios como en conversaciones informales.","id":"language-learning"}],"courseId":"RZ1S0B0MEeacvQ6cODzg5Q","courseSlug":"python-data-analysis","courseCertificates":["VerifiedCert","Specialization"],"courseTypeMetadata":{"t ay detrás de estos métodos. El curso comenzará con una discusión sobre en qué se diferencia el aprendizaje automático de la estadística descriptiva, e introducirá el conjunto de herramientas scikit learn mediante un tutorial. Se discutirá la cuestión de la dimensionalidad de los datos, y se abordará la tarea de agrupar los datos, así como la evaluación de esos agrupamientos. Se describirán los enfoques supervisados para la creación de modelos predictivos, y los alumnos podrán aplicar los métodos de modelado predictivo de scikit learn al tiempo que comprenden las cuestiones del proceso relacionadas con la generalizabilidad de los datos (por ejemplo, validación cruzada, sobreajuste). El curso terminará con una mirada a técnicas más avanzadas, como la construcción de conjuntos, y a las limitaciones prácticas de los modelos predictivos. Al final de este curso, los estudiantes serán capaces de identificar la diferencia entre una técnica supervisada (clasificación) y no supervisada (agrupación), identificar qué técnica deben aplicar para un conjunto de datos y una necesidad concretos, diseñar características para satisfacer esa necesidad y escribir código python para llevar a cabo un análisis. \n\nEste curso debería realizarse después de Introducción a la ciencia de datos en Python y Trazado, gráficos y representación de datos aplicados en Python y antes de Minería de textos aplicada en Python y Análisis social aplicado en Python.","id":"di4l_R0lEeaP7xL2JHHq4w","slug":"python-machine-learning","name":"Aprendizaje automático aplicado en Python","startDate":1496179842204,"courseProgress":"119051348~di4l_R0lEeaP7xL2JHHq4w","v2Details":{"plannedLaunchDate":"May 30","id":"di4l_R0lEeaP7xL2JHHq4w","onDemandSessions":["3thcZ9ogEeifUhIWbzT0_A","9cwwEiZCEe2BOg6H2kGXsw","lzDrd14kEemUUw7fsIK43g","kKaRaaI-EeyXBhIzF1PcYQ","fx0b-OgZEeeNjRJsrw3ZKA","OVrwzi5LEe6n4BI617UjLw","mtBpsWQVEee2fg6zpf5eMg","JQLkiJo2EeuICwqgd6PL8Q","_ZabbsBHEe2kzQ4ZoyZhnQ","5qfBA4w9EeyhBxJSF5zXvw","RZg72AYiEem_NQ6
